import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  function alert(e) {
    e.preventDefault();
    console.log('The link was clicked.');
  }
  return (
    <button onClick={alert}>
      Click me
    </button>
  );






}

export default App;
